CREATE SEQUENCE SQ_ADDRESS_PK START 1;

CREATE TABLE ADDRESS(
  ADDRESS_PK INTEGER DEFAULT nextval('SQ_ADDRESS_PK'),
  STREET VARCHAR(100) NOT NULL,
  STREET_NUMBER VARCHAR(10) NOT NULL,
  POSTCODE VARCHAR(20) NOT NULL,
  CITY VARCHAR(100) NOT NULL,
  DOOR_NUMBER VARCHAR(10),
  PROVINCE VARCHAR(100),
  CONSTRAINT C_ADDRESS_PK PRIMARY KEY(ADDRESS_PK)
);

-- add foreign key to person table
ALTER TABLE PERSON ADD COLUMN ADDRESS_ID INTEGER;
ALTER TABLE PERSON ADD CONSTRAINT FK_ADDRESS FOREIGN KEY (ADDRESS_ID) REFERENCES ADDRESS(ADDRESS_PK);

